import React from 'react';
import './header.css';
import { Link } from 'react-router-dom';

const Header = () => {
  return (
    <div className="container">
      <div>
        <span>Home</span>
      </div>
       
        <ul  className="navbar">
          <li>
            <Link to="/home">Home</Link>
          </li>
          <li>
            <Link to="/data">Data</Link>
          </li>
        </ul>
    
      <div>
        <button>Logout</button>
      </div>
    </div>
  );
};

export default Header;
